import React, { Component } from "react";
import Login from "./ApplicantPages/Login";
import Menu from "./ApplicantPages/Menu";
import LeftMenu from "./ApplicantPages/LeftMenu";
import { Container, Row, Col } from "reactstrap";
import Applicants from "./Applicants";
import Register from "./Register";
// import Profile from "./Profile";
import Logout from "./Logout";
import Programs from "./ApplicantPages/Programs";

import NewRegister from "./ApplicantPages/NewRegister";
import Footer from "./ApplicantPages/Footer";
import Notification from "./CommonPages/Notification";
import Profile from "./CommonPages/Profile";

import UploadDocuments from "./ApplicantPages/UploadDocuments";
import ChangePassword from "./ApplicantPages/ChangePassword";
import OpenProgram from "./DepartmentPages/OpenProgram";
import EditProgram from "./DepartmentPages/EditProgram";


export default class App extends Component {
  state = {
    currentCategory: "",
    leftMenuInfo: { title: "LeftMenu" },
    menuInfo: { title: "IZTECH GRADUATE PROGRAM" },
    loginInfo: { title: "Login" },
    applicantInfo: { title: "Applicants" },
    ProfileInfo: { title: "Profile" },
    ProgramsInfo: { title: "Programs" },
    programs: [],
    program:{
      alesRequirement: true,
      sgkRequirement: true,
      masterRequirement: true,
      quota: 6,
      _id: "5ecc3ecdf495810004264814",
      name: "NanoTech Material Design",
      department: "Material Design Engineering",
      degree: "Doctorate",
      coordinator: {
          name: "Jesica",
          surname: "Hofman",
          email: "hofman@gmail.com",
          phone: "+905350896532",
          address: "Gulbahce Mahallesi 434.sokak no:26"
      },
      description: "If the accepted students to the M.Sc. Program are not graduates of Computer Engineering or Software Engineering undergraduate programs, they are obliged to complete the following courses (in one year) before starting to the Computer Engineering M.Sc. program",
      announceDate: "2020-04-28T00:00:00.000Z",
      applicationDeadline: "2020-06-30T00:00:00.000Z",
      __v: 0
  },
    menuElements: [
      { CategoryName: "Register" },
      { CategoryName: "Login" },
      { CategoryName: "Profile" },
      { CategoryName: "Programs" },
      { CategoryName: "Logout" },
    ],
  };

  changeIsLoggedIn = (LoggedIn) => {
    this.setState({ isLoggedIn: LoggedIn });
  };

  changeCategory = (category) => {
    this.setState({ currentCategory: category.CategoryName });
    this.render();
  };

  setPrograms = (programs) => {
    this.setState({ programs: programs });
  };

  openCategory = () => {
    switch (this.state.currentCategory) {
      case "Login":
        return (
          <Login
            changeIsLoggedIn={this.changeIsLoggedIn}
            info={this.state.isLoggedIn}
          />
        );
      case "Register":
        return (
          <Register
            currentCategory={this.state.currentCategory}
            info={this.state.loginInfo}
          />
        );
      case "Profile":
        return (
          <Profile
            ProfileInfo={this.state.ProfileInfo}
            changeIsLoggedIn={this.changeIsLoggedIn}
            info={this.state.isLoggedIn}
          />
        );
      case "Programs":
        return (
          <Programs
            setPrograms={this.setPrograms}
            changeCategory={this.changeCategory}
            currentCategory={this.state.currentCategory}
            info={this.state.isLoggedIn}
          />
        );
      case "EditProgram":
        return (
          <EditProgram
            setProgram={this.setProgram}
            changeCategory={this.changeCategory}
            currentCategory={this.state.currentCategory}
            info={this.state.isLoggedIn}
          />
        );
      case "Logout":
        return <Logout />;
      default:
        return null;
    }
  };

  render() {
    return (
      <div className="wrapper">
        {/* <Container>
          <Row>
          <Col xs="3">
              <LeftMenu
                menuElements={this.state.menuElements}
                currentCategory={this.state.currentCategory}
                changeCategory={this.changeCategory}
                showProfile={this.showProfile}
                info={this.state.leftMenuInfo}
              ></LeftMenu>
            </Col>
            <Col xs="9">
            <Row>
            <Menu info={this.state.menuInfo}></Menu>       
            </Row>

            <Row>
                 <NewRegister/>
            </Row>
              </Col>

          </Row>

        </Container> */}
        <div className="row">
          <div className="col-md-2 pr-1">
            <LeftMenu />
          </div>

          <div className="col-md-10 ">
            <div className="row">
              <div className="col-md-12 pr-1">
                <Menu />
              </div>
            </div>
            <div className="row">
              <div className="col-md-12 pr-1">
                {/* <NewRegister /> */}

                {/* <Notification/> */}
                {/* <UploadDocuments /> */}
                {/* <Programs/> */}
                {/* <Profile/> */}
                {/* <ChangePassword/> */}
                {/* <OpenProgram/> */}
                <EditProgram program={this.state.program}/>


              </div>
            </div>
            <div className="row">
              <div className="col-md-12 pr-1">
                <Footer />
              </div>
            </div>
          </div>

          {/* <div className="col-md-3 pr-1">
              <Login />
              </div> */}
        </div>
      </div>
    );
  }
}
